import React from "react";
import Card from "../../components/Card";
import Wrapper from "../../components/Wrapper";
import Footer from "../../components/Footer";

function Portfolio() {
  return (
    <div>
      <Wrapper>
        <Card />
        <Footer />
      </Wrapper>
      <Footer />
    </div>
  );
}
export default Portfolio;
